import React from 'react'

function Main(){
    return (
        <div style={{backgroundColor: "#012345"}} >
            <ul>
                <li>Item 1</li>
                <li>Item 2</li>
                <li>Item 3</li>
            </ul>     
        </div>
    )
}

export default Main
